    data: |
      SELECT + + col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE - col0 NOT BETWEEN NULL AND - col0 * - 42 * + - col0;
  - name: tab0

outputs:
  - name: q9932.out
    data: |
      15
      87
      97
